INSERT INTO `seo_data` (`id`, `pagename`, `seo_title`, `seo_description`, `update_at`) VALUES
(1, 'home', 'Driving School in New York | Sk Driving School', 'One of the best driving schools in New York. Offering services like Driving lessons, Road test Appointments, 5 hr online courses, Female instructors, etc.', '2022-02-22 20:19:24'),
(2, 'home_banner_1_caption', '', 'The 5-Hour course is also known as the Pre-Licensing Course demonstrates to you the information and abilities you really want to turn into a more secure, more dependable driver.', '2022-02-11 15:47:30'),
(3, 'home_banner_1_title', 'Road Test, 5 hr course, Highway lesson, Driving school, New York.', '5-Hour-Course', '2022-02-22 20:19:24'),
(4, 'home_banner_1_image_alt', '', 'SK Driving School, New York.', '2022-02-14 17:05:06'),
(5, 'home_banner_2_title', '', 'Basic Packages', '2021-12-30 16:57:23'),
(6, 'home_banner_2_caption', '', 'Modify your course according to your necessity. Get the best out of us. We teach driving lessons for beginners, intermediate and advanced drivers.', '2021-12-30 17:00:49'),
(7, 'home_banner_2_image_alt', '', 'SK Driving School, New York.', '2022-02-14 17:05:06'),
(8, 'home_banner_3_title', '', 'Highway Driving Lesson', '2022-05-11 17:29:06'),
(9, 'home_banner_3_caption', '', 'Modify your course according to your necessity. Get the best out of us. We teach driving lessons for beginners, intermediate and advanced drivers.', '2021-12-30 17:00:49'),
(10, 'home_banner_3_image_alt', '', 'SK Driving School, New York.', '2022-02-14 17:05:06'),
(11, 'home_image_section_1', '', 'Our instructors truly know tips and tricks of moving an amateur driver toward safe and self-assured driver.', '2021-12-30 16:58:18'),
(12, 'home_image_section_1_image_alt', '', 'SK Driving School, New York.', '2022-02-14 17:05:06'),
(13, 'home_image_section_2', '', 'Our instructor will direct you through the functional and theoretical side of driving and can even run a mock test for you, so you are ready for road test.', '2021-12-30 16:58:18'),
(14, 'home_image_section_1_image_alt', '', 'SK Driving School, New York.', '2022-02-14 17:05:06'),
(15, 'home_image_section_3', '', 'Our carefully design lessons mean that we are geared up to help you pass.', '2021-12-30 16:58:18'),
(16, 'home_image_section_1_image_alt', '', 'SK Driving School, New York.', '2022-02-14 17:05:06'),
(17, 'home_feature_caption_1', '', 'We have wide range of packages from 2 driving lesson packages to 20 driving lesson packages.', '2021-12-30 17:00:27'),
(18, 'home_feature_caption_2', '', 'Students have opportunity to set up their class schedule according to their prefer time and date.', '2021-12-30 17:04:26'),
(19, 'home_feature_caption_3', '', 'We teach driving lessons for beginners, intermediate and advanced drivers. If you have some driving experience, we will take you on the road for an assessment.', '2021-12-30 17:04:26'),
(20, 'home_feature_caption_4', '', 'We will help you to book your road test appointment. After successfully passing the road test you can have your Driving license.', '2021-12-30 17:07:40'),
(21, 'footer_caption', '', 'SK Driving School, the place where you will get one of the most advanced and intensive driving training available in the New York city area.', '2021-12-30 17:08:34');
